import React, { Component } from 'react';

const fetchSignup = async (username, password) =>{
  const reqOptions = {
      method: 'POST',
      headers:  { 'Content-Type': 'application/json' },
      body : JSON.stringify({username, password})
  };
  try {
      let res = await fetch('http://localhost:8766/user/signup', reqOptions)
      let resJson = await res.json()
      return resJson;
  } catch (e){
      if (e){
          console.log(e)
      }
  }
}
class SignUp extends Component {
  constructor(props){
    super(props)
    this.state={
      username: undefined,
      password: undefined,
      title:"Signup Page"
    }
  }
  handleChangeUsername(value){
    this.setState({
      username: value,
    })
  }
  handleChangePassword(value){
    this.setState({
      password: value,
    })
  }
  render(){
    return(
      <h1>{this.state.title}</h1>
    )
  }
}
